window.incompatibleBrowser=function(a){window.removeEventListener("error",window.incompatibleBrowser);window.location.href=("https://shell.com/"===window.location.href?"https://shell.com/":"https://localhost/shell/")+"incompatible-browser?filename="+encodeURI(a.filename)+"&lineno="+encodeURI(a.lineno)+"&colno="+encodeURI(a.colno)+"&message="+encodeURI(a.message)};window.addEventListener("error",window.incompatibleBrowser);window.DOMContentLoaded;
